import './css/App.css';
import React, { useEffect, useState } from 'react'
import Checksign from './chk_sign'
import Head from './head'

function App() {
    var change = 0;
    var [ini, fin] = useState(<Checksign />)
    useEffect(() => {
        fetch('/login_state')
            .then(res => res.json())
            .then((data) => {
                if (data.status === 1) {
                    fin(<Head />)
                    change = 1;
                }
                else{
                    fin(<Checksign/>)
                }
            })
        },[change])
        return (
            <div className="App">
                {ini}
            </div>
        )
    }

export default App
